import RadioButtons from "src/components/Radio";
import SimpleSelect from "src/components/Select";
import DiscreteSlider from "src/components/Slider";
import TransferList from "src/components/TrList";
import ContainedButtons from "src/components/Button";

export default function Index() {
  return (
    <div>
      <p>選択方法一覧</p>
      <div>
        <div>単一選択（ラジオボタン）</div>
        <RadioButtons></RadioButtons>
      </div>
      <div>
        <div>単一選択（セレクトボックス）</div>
        <SimpleSelect></SimpleSelect>
      </div>
      <div>
        <div>単一選択（セレクトボックス）</div>
        <DiscreteSlider></DiscreteSlider>
      </div>
      <div>
        <div>単一選択（可動式選択）</div>
        <TransferList></TransferList>
      </div>
      <div>
        <div>ボタン選択</div>
        <ContainedButtons></ContainedButtons>
      </div>
    </div>

  );
}
